  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Potomac
  River National Wildlife Refuge Complex outlines Refuge accomplishments during the
  2011 fiscal year. The report begins with a summary of the year's highlights and
  personnel. The report includes a planning section which discusses the CCPs. Visitor
  Services is outlined and special events/programs are highlighted. Law enforcement
  is also covered with details of violations.  The equipment and facilities section
  of the report provides information about major maintenance, rehabilitation, equipment
  replacement, computer systems, and energy conservation. Topics covered under wildlife
  and habitat management include the big game hunt, animal control, invasive plant
  species management, MAPS banding, and other unusual wildlife sightings.\",\n\t\"owner_org\":
